} fn binary_search(array: Vec<i32>, token: i32) -> Option<usize> { let mut low = 0; let mut high = array.len() - 1; while low <= high { let mid = (low + high) / 2; if array[mid] == token { return Some(mid); } else if token < array[mid] { high = mid - 1; } else { low = mid + 1; } } None
}

